import React from 'react';
import photo from '../headshot.jpg'
import {
    AboutPageContainer,
    Photo,
    PhotoBackground
} from './about.styled'

const About = () => {
    return (
        <AboutPageContainer>
            <PhotoBackground />
            <Photo src={photo} alt="Jacob Rast Picture" width="150px" height="150px"></Photo>      
            Hello, I'm Jacob. Master student in    
        </AboutPageContainer>
    )
}

export default About;
